DROP TABLE IF EXISTS `invoices`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `invoices` (
  `uid` int(11) NOT NULL auto_increment,
  `contract_id` int(11) NOT NULL,
  `number` varchar(11) collate utf8_bin NOT NULL,
  `project_id` int(11) NOT NULL,
  `invoiced` tinyint(1) NOT NULL,
  `change` tinyint(1) NOT NULL,
  `invoiced_date` date NOT NULL,
  `company_id` int(11) NOT NULL,
  `date_modified` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `date_added` timestamp NOT NULL default '0000-00-00 00:00:00',
  `description` text collate utf8_bin NOT NULL,
  `status` int(11) NOT NULL default '1',
  `amount` double NOT NULL,
  `timediff` tinyint(4) NOT NULL default '0',
  `timediff_amount` int(11) NOT NULL,
  `comment` text collate utf8_bin NOT NULL,
  PRIMARY KEY  (`uid`),
  UNIQUE KEY `uid` (`uid`),
  KEY `date_modified` (`date_modified`,`date_added`),
  KEY `change` (`change`)
) ENGINE=MyISAM AUTO_INCREMENT=428 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
